 class="ui-icon ui-icon-alert"></span>Report </a> <a class="qrbtn fg-button ui-state-default fg-button-icon-left ui-corner-all" data-num="140665" data-thread="132677"> <span class="ui-icon ui-icon-comment"></span>Quick Reply </a>  <!--<i style="color: #1813A3; font-size:16px; margin-left: 5px;"class="glyphicon  glyphicon-birthday_cake"></i>--> </div>  <blockquote  class="h31313636353930343833">  &gt;&gt;140331<br>So the real message here is &quot;Be Dishonest&quot;?<br><br>I&#39;ve already said this before: I hate the sites that put the content behind a paywall since they&#39;re profiting from somebody else&#39;s work. Do you really think we didn&#39;t contact them? It&#39;s not our fault they&#39;re being asshats for not removing the content. Hell, we&#39;re working on getting something to make sure those sites will follow the DCMA notices.<br><br>I don&#39;t do this because I hate you guys. I do it because I support the artists. You say that piracy doesn&#39;t equal lost sales. But how does that help an artist? An artist makes a title and then it&#39;s out for free? That shit can be discouraging to see a few sales and a lot of people pirating it. Oh and for the most part, I only contact the artists to let them know about what&#39;s going on. It&#39;s their choice of either following through or not. Sometimes they do, sometimes they don&#39;t.<br><br>Besides, there&#39;s plenty of porn out there for you to find. Your dick can wait a few months when it&#39;s widespread. That or you could buy it. Just sayin&#39;.<br><br>&gt;&gt;140637<br>Oh please. I get it. You want porn, but you&#39;re poor. So you download it for free. I honestly can live with that excuse (I&#39;m not even angry about that part). But stop making up excuses where you sound like you&#39;re a paragon of virtue. The fact that you villianize us for protecting our product is BS. You know full well you&#39;re only trying to justify your actions to yourself. You have your right to buy or not buy any porn. Just like how other artists and myself have the right to keep or remove any pirated links of our stuff.<br><br>Oh and btw, the internet was designed for easier communication between governments, not so you can get your fap on. That came later just like everything else (and thank god it did).   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/132677.php#140681" onclick="highlight(140681);">&gt;&gt;</a></td> <td class="reply" id="reply140681"> <a id="140681"></a> <div class="replyheader"> 									 <span class="commentpostername">420chan JSON API Now Available</span>  - <span class="idhighlight">Mon, 02 Sep 2013 23:28:04 EST ID:kY8osI/Y</span> <span class="reflink">   <a href="javascript:insert('&gt;&gt;140681')">No.140681</a>  </span>  <a class="ignorebtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="toggleIgnored('h31383534353739303134')" title="Ignore User"> <span class="ui-icon ui-icon-cancel"></span>Ignore </a>  <a class="rptbtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="openReport('140681', '132677')" title="Report Post 140681"> <span class="ui-icon ui-icon-alert"></span>Report </a> <a class="qrbtn fg-button ui-state-default fg-button-icon-left ui-corner-all" data-num="140681" data-thread="132677"> <span class="ui-icon ui-icon-comment"></span>Quick Reply </a>  <!--<i style="color: #3E99B5; font-size:16px; margin-left: 5px;"class="glyphicon  glyphicon-birthday_cake"></i>--> </div>  <blockquote  class="h31383534353739303134">  new filesharing motherfuckers...<br><a href="http://volafile.io/" rel="nofollow" target="_blank">http://volafile.io/</a><br><br>upload to this plox   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/132677.php#140877" onclick="highlight(140877);">&gt;&gt;</a></td> <td class="reply" id="reply140877"> <a id="140877"></a> <div class="replyheader"> 									 <span cl