n ui-state-default fg-button-icon-solo ui-corner-all" onclick="toggleIgnored('h31313636353930343833')" title="Ignore User"> <span class="ui-icon ui-icon-cancel"></span>Ignore </a>  <a class="rptbtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="openReport('143986', '132677')" title="Report Post 143986"> <span class="ui-icon ui-icon-alert"></span>Report </a> <a class="qrbtn fg-button ui-state-default fg-button-icon-left ui-corner-all" data-num="143986" data-thread="132677"> <span class="ui-icon ui-icon-comment"></span>Quick Reply </a>  <!--<i style="color: #FF617B; font-size:16px; margin-left: 5px;"class="glyphicon  glyphicon-birthday_cake"></i>--> </div>  <span class="filesize"> <a target="_blank" href="/h/src/1379629198581.jpg"> 1379629198581.jpg </a> -(<em>33995 B, 600x495</em>) <span class="thumbnailmsg">Thumbnail displayed, click image for full size.</span> </span>  <a onclick="return imageExpansion(this)" target="_blank" href="/h/src/1379629198581.jpg"> <img src="/h/thumb/1379629198581s.jpg" alt="33995" class="thumb" /> </a>    <blockquote  class="h31313636353930343833">  &gt;&gt;143724<br><blockquote class = "unkfunc">&gt;In my experience, artists trend to frown upon plagiarism moreso than someone not giving them money they feel entitled to. The fact that some of the older paid content still nets sales offers a stark contrast to this arbitrary one-month policy. Sales are still made and efforts seem no less deterred for it.<br></blockquote><br>Artists tend to frown on several things: Plaglarism, piracy, bad commission clients, etc. Just because one is frowned upon more than the other doesn&#39;t mean it&#39;s not looked at any different. No artist is happy with either of these things happening. I mean, unless they&#39;re a glutton for punishment.<br><br>You do make the occasional sales, but majority happen in the first month. We say wait a month or two, so the artist can get most of their sales. <br><br><blockquote class = "unkfunc">&gt;I wouldn&#39;t presume to know whether you were the type to toil over search engines to find sharing communities to piss on - all while daintily worming away from the paywall fortresses that openly mock (and appreciate) your efforts. In the end, it isn&#39;t a huge barrier to my access. Not really my problem.<br></blockquote>Yeah, I don&#39;t have time to search through millions of sites, going around and pissing people off. In fact, the only reason why I come here often is because of the close proximity to one of the other boards on here that I go to. If I happen to spot it, I notify the artist. If they want to take action, it&#39;s their choice.<br><br>Yes, I hate the paywall sites like youngmike for what they&#39;re doing and it&#39;s always an ongoing battle to get them to stop doing their practice. But how does that make you any better to mock me and tell me to just give up?<br><br><blockquote class = "unkfunc">&gt;No, I reach out because a part of me somewhat cares. The gulf between the ideals you claim to express and the means by which you uphold them resembles someone trying to fling rocks across the grand canyon. The people you&#39;re aiming at are lucky to even notice and you&#39;re only hitting people below. <br></blockquote><br>It seems I&#39;ve caught your attention, didn&#39;t I?<br><br>Again, I don&#39;t hate majority of you for wanting to see this stuff and wanting to pirate it. But I can&#39;t say I approve of it.   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/132677.php#143993" onclick="highlight(143993);">&gt;&gt;</a></td> <td class="reply" id="reply143993"> <a id="143993"></a> <div class="replyheader"> 									 <span class="commentpostername">erogenesis</span>  - <span class="idhighlight">Thu, 19 Sep 2013 19:23:28 EST ID:q5ZgO8Lw</span> <span class="reflink">   <a href="javascript:insert('&gt;&gt;143993')">No.143993</a>  </span>  <a class="ignorebtn fg-button ui-state-default fg