>  <blockquote  class="h31323736343030363836">  &gt;&gt;144022<br>First of all, go fuck yourself for using hate speech which demeans an entire community.<br>Second of all, there are a few misconceptions you have about how markets work. First of all, the music industry was &quot;killed&quot; by competition. Despite the record labels wanting to be able  to blame everything on the consumer, they have to recognize one thing. Consumers have limited capital, and  will distribute said capital as they find most appropriate. In the case of the music industry, this is exemplified by people going to local shows and seeing local musicians with similar talent levels, instead of the mass produced mega stars. The popular music that is often pirated, contrary to what the industry says, would likely not be downloaded at all if piracy was not an option.<br>The fact that people are &quot;stealing&quot; your work, is not representative of them being &quot;pussies&quot;, but instead of yourself overpricing the value of your own labor. If you are going to be an artist as a profession, you will never be able to charge everyone who enjoys your art, it&#39;s the nature of the craft. The reason you personally will be affected by this so much is the niche specificity of your work, your potential customer pool is quite small, and because you overprice your work, you are unlikely to get many legitimate purchases.<br><br>P.S. I have not pirated any of your renders, because they are awful.   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/132677.php#144131" onclick="highlight(144131);">&gt;&gt;</a></td> <td class="reply" id="reply144131"> <a id="144131"></a> <div class="replyheader"> 									 <span class="commentpostername">erogenesis</span>  - <span class="idhighlight">Fri, 20 Sep 2013 06:15:24 EST ID:q5ZgO8Lw</span> <span class="reflink">   <a href="javascript:insert('&gt;&gt;144131')">No.144131</a>  </span>  <a class="ignorebtn 