 href="javascript:insert('&gt;&gt;144491')">No.144491</a>  </span>  <a class="ignorebtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="toggleIgnored('h32393037323732393034')" title="Ignore User"> <span class="ui-icon ui-icon-cancel"></span>Ignore </a>  <a class="rptbtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="openReport('144491', '132677')" title="Report Post 144491"> <span class="ui-icon ui-icon-alert"></span>Report </a> <a class="qrbtn fg-button ui-state-default fg-button-icon-left ui-corner-all" data-num="144491" data-thread="132677"> <span class="ui-icon ui-icon-comment"></span>Quick Reply </a>  <!--<i style="color: #E14EF8; font-size:16px; margin-left: 5px;"class="glyphicon  glyphicon-birthday_cake"></i>--> </div>  <blockquote  class="h32393037323732393034">  &gt;&gt;144022<br><br>Coming to this board to whine is a clear invitation to get trolled and watch us pirates keep piratin&#39;  Just as with Supro, same goes for you.  Most you&#39;re doing is managing an inconvenience for the less robust, while weaseling around or maybe nipping at the heels of the people really profiting from your work.  <br><br>So no, you&#39;re no badass, don&#39;t even try that angle, lol.<br><br>I&#39;ll share your stuff as a courtesy to the community.  Buy it if I think it&#39;s worth it.  All of the crying in the world won&#39;t change that.  We&#39;re pirates, we sail on the seas of your tears.<br><br>&gt;&gt;144090<br><br>Respect for this, though.  Much better approach to take.<br><br><a href = "/h/res/132677.php#144127" onclick = "highlight(144127)">&gt;&gt;144127</a><br><a href = "/h/res/132677.php#144131" onclick = "highlight(144131)">&gt;&gt;144131</a><br><br>You&#39;re sort of both wrong.  Piracy has had no direct impact on the strength of the industry.  They&#39;ve gone years through making record profits.  Problem is competition, new technology, and a growing trend to eschew corporate.<br><br>Assuming that everyone who sees your material would have paid for it if forced to is stupid.  It&#39;s wrong on it&#39;s face.<br><br>On a side note.<br><br>Protip:  Price within impulse-buy range, make payment as convenient as possible.   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/132677.php#144575" onclick="highlight(144575);">&gt;&gt;</a></td> <td class="reply" id="reply144575"> <a id="144575"></a> <div class="replyheader"> 									 <span class="commentpostername">dezel shitzer</span>  - <span class="idhighlight">Sun, 22 Sep 2013 18:02:34 EST ID:vzmVnF5P</span> <span class="reflink">   <a href="javascript:insert('&gt;&gt;144575')">No.144575</a>  </span>  <a class="ignorebtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="toggleIgnored('h31313635353834303639')" title="Ignore User"> <span class="ui-icon ui-icon-cancel"></span>Ignore </a>  <a class="rptbtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="openReport('144575', '132677')" title="Report Post 144575"> <span class="ui-icon ui-icon-alert"></span>Report </a> <a class="qrbtn fg-button ui-state-default fg-button-icon-left ui-corner-all" data-num="144575" data-thread="132677"> <span class="ui-icon ui-icon-comment"></span>Quick Reply </a>  <!--<i style="color: #6CCD43; font-size:16px; margin-left: 5px;"class="glyphicon  glyphicon-birthday_cake"></i>--> </div>  <span class="filesize"> <a target="_blank" href="/h/src/1379887354160.jpg"> 1379887354160.jpg </a> -(<em>25170 B, 921x606</em>) <span class="thumbnailmsg">Thumbnail displayed, click image for full size.</span> </span>  <a onclick="return imageExpansion(this)" target="_blank" href="/h/src/1379887354160.jpg"> <img src="/h/thumb/1379887354160s.jpg" alt="25170" class="thumb" /> </a>    <blockquote  class="h31313635353834303639">  Jesus fucking Christ people   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/1