nd pirate all of the assets, you are a fucktard.<br><br>Only when 3DX artists utilize unique assets, modeled personally in Maya/3D Studio Max would it actually be feasible for shit to be MASSIVELY overpriced.<br><br>As it stands, most of the shit we &quot;piraters&quot; go for is post-processed Poser shit. E.G. glorified dolls on a canvas.   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/132677.php#144927" onclick="highlight(144927);">&gt;&gt;</a></td> <td class="reply" id="reply144927"> <a id="144927"></a> <div class="replyheader"> 									 <span class="commentpostername">The Real Mongo Bongo</span>  - <span class="idhighlight">Tue, 24 Sep 2013 12:47:43 EST ID:cHEPyRDB</span> <span class="reflink">   <a href="javascript:insert('&gt;&gt;144927')">No.144927</a>  </span>  <a class="ignorebtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="toggleIgnored('h31313938323831383938')" title="Ignore User"> <span class="ui-icon ui-icon-cancel"></span>Ignore </a>  <a class="rptbtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="openReport('144927', '132677')" title="Report Post 144927"> <span class="ui-icon ui-icon-alert"></span>Report </a> <a class="qrbtn fg-button ui-state-default fg-button-icon-left ui-corner-all" data-num="144927" data-thread="132677"> <span class="ui-icon ui-icon-comment"></span>Quick Reply </a>  <!--<i style="color: #D1B1AA; font-size:16px; margin-left: 5px;"class="glyphicon  glyphicon-birthday_cake"></i>--> </div>  <span class="filesize"> <a target="_blank" href="/h/src/1380041263806.png"> 1380041263806.png </a> -(<em>136656 B, 361x358</em>) <span class="thumbnailmsg">Thumbnail displayed, click image for full size.</span> </span>  <a onclick="return imageExpansion(this)" target="_blank" href="/h/src/1380041263806.png"> <img src="/h/thumb/1380041263806s.jpg" alt="136656" class="thumb" /> </a>    <blockquote  class="h31313938323831383938">  &gt;