eIgnored('h31313431333234353835')" title="Ignore User"> <span class="ui-icon ui-icon-cancel"></span>Ignore </a>  <a class="rptbtn fg-button ui-state-default fg-button-icon-solo ui-corner-all" onclick="openReport('197196', '132677')" title="Report Post 197196"> <span class="ui-icon ui-icon-alert"></span>Report </a> <a class="qrbtn fg-button ui-state-default fg-button-icon-left ui-corner-all" data-num="197196" data-thread="132677"> <span class="ui-icon ui-icon-comment"></span>Quick Reply </a>  <!--<i style="color: #B1F148; font-size:16px; margin-left: 5px;"class="glyphicon  glyphicon-birthday_cake"></i>--> </div>  <blockquote  class="h31313431333234353835">  &gt;&gt;197144<br><blockquote class = "unkfunc">&gt;To be honest, I&#39;m not a fan of the DCV thing. If there was animation integrated with the images then I&#39;d understand a viewer, but I think that there&#39;s just the 3D model rotation feature for the Dossier series.<br></blockquote><br>There IS animation... In the bigger releases. The DCV also uses sound effects and music, character bios, 3D turntables, wallpapers, and other cool shit. If all you&#39;ve seen is the Dossiers, then you&#39;re missing out. The comics are where it&#39;s at. <br><br><blockquote class = "unkfunc">&gt;As an aside, is it just me? Kendra Blake looks more like a plastic doll compared to Ember Riley, even though she&#39;s in the more recent image set. <br></blockquote><br>Kendra is a character created in 2006 (you&#39;d know this if you went to his website). So she&#39;s dated by most standards compared to models he&#39;s created more recently. She&#39;s in an old comic of his called &quot;Freehope&quot;.<br><br>Man, I swear you Johnny-come-lately faggots should learn a thing or two about the artists before spouting all your bullshit and criticizing what you get for fucking free.   </blockquote>    				 </td> </tr> </tbody> </table>     <table><tbody><tr><td class="doubledash"><a href="/h/res/132677.php#197546" onclick="highlight(1975